const Data = msg.payload; //Definiere den payload (output) auf eine Variable, welche konstant ist

// Konvertiere es zu einem Array
const DataArray = Data.split("start").filter(Boolean).toLowerCase();

// Wenn ein Fehler (beim Sensor gibt er "fail" aus) vorkommt
if(DataArray[1].includes("fail")){
    // Ã„ndere die "OUPUT" Nachricht um, indem die Data, der Output und die ganzen anderen pre-deklarierten Variablen vorkommen.
    msg = {
        Data:{ topic: "Data", payload: Data},
        Output:{ topic: "Fail", payload: "Fail"},
        Probability: { topic: "Probability", payload: 0}, //0 da ein fehler ist und im dashboard 0 soll stehen
        Models: { topic: "Models", payload: 0}, //0 da ein fehler ist und im dashboard 0 soll stehen
        Objects: { topic: "Objects", payload: 0}, //0 da ein fehler ist und im dashboard 0 soll stehen
        CordX: { topic: "CordX", payload: 0}, //0 da ein fehler ist und im dashboard 0 soll stehen
        CordY: { topic: "CordY", payload: 0}, //0 da ein fehler ist und im dashboard 0 soll stehen
        Degree: { topic: "Degree", payload: 0} //0 da ein fehler ist und im dashboard 0 soll stehen
    };
   }
else {
    const Success = DataArray[1].slice(4).replace("stop", "").split("#").filter(Boolean).map(d => Number(d));
    const [ Probability, Models, Objects, CordX, CordY, Degree ] = Success;
    msg = {
        Data: { topic: "Data", payload: Data},
        Output: { topic: "Success", payload: "Success"},
        Probability: { topic: "Probability", payload: Probability},
        Models: { topic: "Models", payload: Models},
        Objects: { topic: "Objects", payload: Objects},
        CordX: { topic: "CordX", payload: CordX},
        CordY: { topic: "CordY", payload: CordY},
        Degree: { topic: "Degree", payload: Degree}
    };
}
return [msg.Output, msg.Probability, msg.Model, msg.Objects, msg.CordX, msg.CordY, msg.Degree];
